import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import SignUpPage from './Pages/SignUpPage/SignUp';
import './App.css';
import logo from './logo.svg';

function App() {
  return (
    <Router>
      <div className="App">

        <Routes>
          <Route path="/signup" element={<SignUpPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
